// src/pages/ProfilePage.js
import React from 'react';
import styled from 'styled-components';
import { DEFAULT_THEME } from './shop/LiveShopCreation';
import NavMenu from './shop/components/NavMenu';

const PageContainer = styled.div`
  min-height: 100vh;
  background: ${props => props.theme?.colors?.background || DEFAULT_THEME.colors.background};
  color: ${props => props.theme?.colors?.text || DEFAULT_THEME.colors.text};
  padding: 2rem;
`;

const ProfilePage = () => {
  return (
    <PageContainer>
      <NavMenu />
      <h1>Profile</h1>
      <p>Profile page coming soon...</p>
    </PageContainer>
  );
};

export default ProfilePage;
